(66, 'Kost 59', '164499121322', 'Jakarta barat', 'Jl anggrek neli murni viii no 59\nKemanggisan - Palmerah\nJakarta Barat 11480', '1', NULL, NULL, NULL, NULL, NULL, '500000', NULL, '108', '2022-02-16 13:23:16', '2022-02-16 13:26:19'),
(67, 'Kost 59', '1644992781239', 'Jakarta barat', 'Jl anggrek neli murni viii no 59\nKemanggisan - Palmerah\nJakarta Barat - 11480', '0', NULL, NULL, NULL, NULL, NULL, '500000', '1.	Untuk ketenangan dan keamanan bersama, pintu utama dan gerbang pastikan selalu terkunci.\n2.	Tamu hanya diizinkan maksimal sampai jam 22.00. Khusus malam minggu/libur sampai jam 23.00.\n3.	Setiap penghuni wajib menyerahkan foto copy KTP dan nomer telepon keluarga yang mudah dihubungi pada saat keadaan darurat.\n4.	Kamar dilarang dipinjamkan kepada orang lain. Hanya keluarga yang diizinkan menginap, maksimum 2 malam gratis dalam sebulan, selebihnya dikenakan biaya sebesar Rp. 150.000/malam. Setiap penginap diharuskan melapor kepada penjaga kost. \n5.	Untuk kesehatan dan kebersihan bersama, dilarang keras merokok baik dikamar atau koridor. Merokok hanya di area parkir.\n6.	Untuk kenyamanan bersama, dilarang berbuat gaduh, suara musik/TV agar disesuaikan cukup untuk kamar masing-masing. Bila masuk area kost agar segera matikan motor.\n7.	Untuk menghindari kebakaran, dilarang masak di dalam kamar. Kerusakan yang timbul akibat kelalaian penghuni menjadi tanggung jawab yang bersangkutan. Sebaiknya gunakan dapur umum yang telah disediakan.\n8.	Dilarang untuk menancapkan paku atau hal lainnya yang menyebabkan kerusakan baik pada dinding, pintu dan semua perabot yang ada di area kos. Bila ditemukan maka akan dikenakan denda 250.000 per titik kerusakan.\n9.	Dilarang keras berbuat asusila dilingkungan kost. Pelanggaran akan dilaporkan ke pihak yang berwajib.\n10.	Dilarang keras menggunakan/mengedarkan minuman keras, narkotika dan obat-obat terlarang lainnya dilingkungan kost. Pelanggaran akan dilaporkan ke pihak yang berwajib.\n11.	Penyewa kost dapat mengakhiri sewa menyewa kost. Masing-masing harus memberi tahu minimal 30 hari sebelumnya, kurang dari waktu yang ditentukan dikenakan pinalti dengan tidak dikembalikannya uang jaminan senilai 1 juta rupiah.\n12.	Pemilik Kost dapat mengakhiri masa sewa kost kepada penyewa kapanpun apabila ditemukan hal yang menyebabkan terganggu nya kenyamanan dan ketertiban kost tanpa deposit kembali.\n13.	Penyewa kost wajib memberikan jaminan senilai 1 juta rupiah. Yang dapat dipakai untuk pembayaran listrik dan kelebihannya akan dikembalikan di bulan terakhir menyewa apabila poin 11 terpenuhi dan tidak ada property milik Kost 59 yang rusak.\n14.	Biaya sewa dibayarkan paling lambat 5 hari setelah bulan baru sewa berjalan (tanggal 5 setiap bulan baru), bila terlambat maka kami berhak mebatalkan sewa di bulan berikutnya.\n15.	Keterlambatan pembayaran akan dikenakan denda sebesar 50.000 per hari setelah 5 hari tenggang yang diberikan.\n16.	Pembayaran kost dilakukan dengan cara transfer ke rek BCA 5500 01 0055 a/n Andri leonardi. Bukti transfer harus diinfokan segera. Pembayaran diluar transfer tanpa memberikan info terlebih dahulu dianggap belum membayar kost.\n17.	Dalam hal timbul perselisihan antara pihak penyewa dengan pemilik atau penjaga, sepakat untuk menyelesaikan perselisihan yang timbul dengan cara musyawarah untuk memperoleh mufakat.', '108', '2022-02-16 13:40:11', '2022-09-29 16:38:04'),
(68, 'Kost 159 residence', '1664359934254', 'Tanherang selatan', 'Jl.atmaja rt.08 rw.07 baktijaya setu - tangsel', '0', '300000', '150000', NULL, NULL, NULL, '1000000', 'Tidak boleh bawa binatang', '164', '2022-09-28 17:32:47', '2022-09-28 17:33:33'),
(69, 'Purabaya Residence', '1665554582787', 'Bandung', 'Jln Purabaya 31/66', '0', '300000', NULL, NULL, NULL, NULL, '1000000', '1. Untuk ketenangan dan keamanan bersama, pintu utama dan gerbang pastikan selalu terkunci.\n2. Tamu hanya diizinkan maksimal sampai jam 22.00. Khusus malam minggu/libur sampai jam 23.00.\n3. Setiap penghuni wajib menyerahkan foto copy KTP dan nomer telepon keluarga yang mudah dihubungi pada saat\nkeadaan darurat.\n4. Kamar dilarang dipinjamkan kepada orang lain. Hanya keluarga yang diizinkan menginap, maksimum 2 malam\ngratis dalam sebulan, selebihnya dikenakan biaya sebesar Rp. 100.000/malam. Setiap penginap diharuskan melapor\nkepada penjaga kost.\n5. Untuk kesehatan dan kebersihan bersama, dilarang keras merokok baik dikamar atau koridor. Merokok hanya di\narea parkir\n\n6. Untuk kenyamanan bersama, dilarang berbuat gaduh, suara musik/TV agar disesuaikan cukup untuk kamar masing-\nmasing. Bila masuk area kost agar segera matikan motor.\n\n7. Untuk menghindari kebakaran, dilarang masak di dalam kamar. Kerusakan yang timbul akibat kelalaian penghuni\nmenjadi tanggung jawab yang bersangkutan. Sebaiknya gunakan dapur umum yang telah disediakan.\n8. Dilarang untuk menancapkan paku atau hal lainnya yang menyebabkan kerusakan baik pada dinding, pintu dan\nsemua perabot yang ada di area kos. Bila ditemukan maka akan dikenakan denda 250.000 per titik kerusakan.\n9. Dilarang keras berbuat asusila dilingkungan kost. Pelanggaran akan dilaporkan ke pihak yang berwajib.\n10. Dilarang keras menggunakan/mengedarkan minuman keras, narkotika dan obat-obat terlarang lainnya\ndilingkungan kost. Pelanggaran akan dilaporkan ke pihak yang berwajib.\n11. Penyewa kost dapat mengakhiri sewa menyewa kost. Masing-masing harus memberi tahu minimal 30 hari\nsebelumnya, kurang dari waktu yang ditentukan dikenakan pinalti dengan tidak dikembalikannya uang jaminan\nsenilai IDR 1 juta rupiah.\n12. Batas waktu check-out max jam 12.00\n13. Pemilik Kost dapat mengakhiri masa sewa kost kepada penyewa kapanpun apabila ditemukan hal yang\nmenyebabkan terganggu nya kenyamanan dan ketertiban kost tanpa deposit kembali.\n14. Penyewa kost wajib memberikan jaminan deposit senilai 1 juta rupiah yang telah disetujui Yang dapat digunakan\ndi bulan terakhir menyewa apabila poin 11 terpenuhi dan tidak ada property milik Purabaya yang rusak\n15. Biaya sewa dibayarkan paling lambat 5 hari setelah bulan baru sewa berjalan (tanggal 5 setiap bulan baru), bila\nterlambat maka kami berhak mebatalkan sewa di bulan berikutnya.\n16. Keterlambatan pembayaran akan dikenakan denda sebesar 50.000 per hari setelah 5 hari tenggang yang diberikan.\n17. Pembayaran kost dilakukan dengan cara transfer ke rek BCA 3105 993 166 a/n Angelina Cendiany. Bukti transfer\nharus diinfokan segera. Pembayaran diluar transfer tanpa memberikan info terlebih dahulu dianggap belum\nmembayar kost.\n18. Dalam hal timbul perselisihan antara pihak penyewa dengan pemilik atau penjaga, sepakat untuk menyelesaikan\nperselisihan yang timbul dengan cara musyawarah untuk memperoleh mufakat.', '169', '2022-10-12 13:20:48', '2022-10-17 15:21:38'),
